import { createRouter, createWebHistory } from '@ionic/vue-router';
import { RouteRecordRaw } from 'vue-router';
import Main from '../views/Main.vue';
import Register from "../components/RegisterPage.vue";
import AdminPage from "../components/AdminPage.vue";
import RecoverPassword from "../components/RecoverPassword.vue";
import Login from "../components/LoginPage.vue";
import UserInfo from "../components/UserInfo.vue";
import SendPage from "../components/SendPage.vue";
import ReceivePage from "../components/ReceivePage.vue";
import BarcodeScanner from "../components/BarcodeScannerPage.vue";
import VisionAIScanner from "../components/VisionAIScannerPage.vue";
import KeyboardScanner from "../components/KeyboardScannerPage.vue";
import InfoAwards from "../components/InfoAwards.vue";
import InfoContainers from "../components/InfoContainers.vue";
import InfoRecyclingPoints from "../components/InfoRecyclingPoints.vue";
import InfoWaste from "../components/InfoWaste.vue";
import InfoWhyRecycling from "../components/InfoWhyRecycling.vue";
import InfoBlockchain from "../components/InfoBlockchain.vue";
import DetailsRecyclingPoint from "../components/DetailsRecyclingPoint.vue"
import TokensPage from "../components/TokensPage.vue";


const routes: Array<RouteRecordRaw> = [
  {
    path: '/',
    redirect: '/main/home'
  },
  {
    path: '/main/',
    component: Main,
    children: [
      {
        path: '',
        redirect: '/main/home'
      },
      {
        path: 'home',
        component: () => import('@/views/HomeFragment.vue'),
        children: [
          {
            path: "register",
            component: Register,
          },
          {
            path: "login",
            component: Login,
            children: [
              {
                path: "recoverPassword",
                component: RecoverPassword
              }
            ]
          },
          {
            path:"userInfo",
            component: UserInfo
          },
          {
            path:"send",
            component: SendPage,
            name:"send",
            props: true,
          },
          {
            path:"receive",
            component: ReceivePage
          }
        ]
      },
      {
        path: 'search',
        component: () => import('@/views/SearchFragment.vue'),
        children: [
          {
            path: "barcode/:barcodeNum",
            component: BarcodeScanner,
            props: true,
            name: "barcode",
            children: [{
              path: ":residuID",
              component: InfoWaste,
              props: true,
              name: "residu",
            }]
          },
          {
            path: "vision/:visionNum",
            component: VisionAIScanner,
            props: true,
            name: "vision",
            children: [{
              path: ":residuID",
              component: InfoWaste,
              props: true,
              name: "residu",
            }]
          },
          {
            path: "keyboard",
            component: KeyboardScanner,
            children: [{
              path: ":residuID",
              component: InfoWaste,
              props: true,
              name: "residu",
            }]
          }
        ]
      },
      {
        path: 'info',
        component: () => import('@/views/InfoFragment.vue'),
        children: [
          {
            path: "recyclingPoints",
            component: InfoRecyclingPoints,
            children: [{
              path: ":deixalleriaNum",
              component: DetailsRecyclingPoint,
              props: true,
              name: "deixalleria",
            },
            ]
          },
          {
            path: "whyReciclying",
            component: InfoWhyRecycling
          },
          {
            path: "keyboard",
            component: KeyboardScanner,
            children: [{
              path: ":residuID",
              component: InfoWaste,
              props: true,
              name: "residu",
            }]
          },
          {
            path: "containers",
            component: InfoContainers
          },
          {
            path: "awards",
            component: InfoAwards
          },
          {
            path: "blockchain",
            component: InfoBlockchain
          }

        ]
      },
      {
        path: 'settings',
        component: () => import('@/views/SettingsFragment.vue'),
        children: [{
          path: "admin/:adminNum",
          component: AdminPage,
          props: true,
          name: "admin",
          children:[{
            path: "tokensUpdate/:adminNum",
            component: TokensPage,
            props: true,
            name:"tokensUpdate"
          }]
        }]
      },
    ]
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
